INSERT INTO `repositories` (`name`, `description`, `uri`, `website`, `keywords`, `repositoryTypes`, `createdById`, `created`, `modifiedById`, `modified`) (SELECT "ImmPort","The Immunology Database and Analysis Portal (ImmPort) archives clinical study and trial data generated by NIAID/DAIT-funded investigators. Data types housed in ImmPort include subject assessments i.e., medical history, concomitant medications and adverse events as well as mechanistic assay data such as flow cytometry, ELISA, ELISPOT, etc.  ---  You won't need an ImmPort account to search for compelling studies, peruse study demographics, interventions and mechanistic assays. But why stop there? What you really want to do is download the study, look at each experiment in detail including individual ELISA results and flow cytometry files. Perhaps you want to take those flow cytometry files for a test drive using FLOCK in the ImmPort flow cytometry module. To download all that interesting data you will need to register for ImmPort access.","https://www.re3data.org/api/v1/repository/r3d100012529","https://www.immport.org/shared/home","[""FAIR"", ""allergy"", ""clinical research"", ""clinical trials"", ""cytometry"", ""data service"", ""immunology"", ""infectious disease"", ""ontology"", ""proteomics"", ""transcriptomics"", ""transplantation"", ""vaccine""]","[""DISCIPLINARY""]", users.id, CURDATE(), users.id, CURDATE() FROM users WHERE email = 'super@example.com');
INSERT INTO `repositories` (`name`, `description`, `uri`, `website`, `keywords`, `repositoryTypes`, `createdById`, `created`, `modifiedById`, `modified`) (SELECT "NSF Arctic Data Center","The Arctic Data Center is the primary data and software repository for the Arctic section of NSF Polar Programs. The Center helps the research community to reproducibly preserve and discover all products of NSF-funded research in the Arctic, including data, metadata, software, documents, and provenance that links these together.  The repository is open to contributions from NSF Arctic investigators, and data are released under an open license (CC-BY, CC0, depending on the choice of the contributor).  All science, engineering, and education research supported by the NSF Arctic research program are included, such as Natural Sciences (Geoscience, Earth Science, Oceanography, Ecology, Atmospheric Science, Biology, etc.) and Social Sciences (Archeology, Anthropology, Social Science, etc.). Key to the initiative is the partnership between NCEAS at UC Santa Barbara, DataONE, and NOAAs NCEI, each of which bring critical capabilities to the Center. Infrastructure from the successful NSF-sponsored DataONE federation of data repositories enables data replication to NCEI, providing both offsite and institutional diversity that are critical to long term preservation.","https://www.re3data.org/api/v1/repository/r3d100011973","https://arcticdata.io","[""Arctic""]","[""DISCIPLINARY""]", users.id, CURDATE(), users.id, CURDATE() FROM users WHERE email = 'super@example.com');
